import React from "react";
import Home from "./home";
import Kontakt from "./kontakt";
import Oferta from "./oferta";
import Onas from "./onas";
import Przedszkole from "./przedszkole";
import Rekrutacja from "./rekrutacja";
import { BrowserRouter as Router, Routes, Route}
    from 'react-router-dom';
function App () {
  
  return (
    <div>
      <Router>
        <Routes>
          <Route exact path='/' element={<Home/>} />
        <Route exact path='/kontakt' element={<Kontakt/>} />
        <Route exact path='/oferta' component={Oferta} />
        <Route exact path='/onas' component={Onas} />
        <Route exact path='/przedszkole' component={Przedszkole} />
        <Route exact path='/rekutacja' component={Rekrutacja} />
        </Routes>
      </Router>
        
        </div>
    
  );
};

export default App;
